        public static int NumberOfOverlappingRequests()
        {
            var stringInputValues = Input.Split("\r\n");
            var elfClaims = GetElfClaims(stringInputValues);
            var map = new int[1000, 1000];

            foreach (var elfClaim in elfClaims)
            {
                for (var i = elfClaim.StartingPoint[0]; i < elfClaim.StartingPoint[0] + elfClaim.Size[0]; i++)
                {
                    for (var j = elfClaim.StartingPoint[1]; j < elfClaim.StartingPoint[1] + elfClaim.Size[1]; j++)
                    {
                        map[i, j] = map[i, j] == 0 ? elfClaim.Id : -1;
                    }
                }
            }

            return map.Cast<int>().Count(i => i == -1);
        }

        public static ElfClaim FindNonOverlappingClaim()
        {
            var stringInputValues = Input.Split("\r\n");
            var elfClaims = GetElfClaims(stringInputValues).ToList();
            var map = new int[1000, 1000];

            foreach (var elfClaim in elfClaims)
            {
                for (var i = elfClaim.StartingPoint[0]; i < elfClaim.StartingPoint[0] + elfClaim.Size[0]; i++)
                {
                    for (var j = elfClaim.StartingPoint[1]; j < elfClaim.StartingPoint[1] + elfClaim.Size[1]; j++)
                    {
                        map[i, j] = map[i, j] == 0 ? elfClaim.Id : -1;
                    }
                }
            }

            foreach (var elfClaim in elfClaims)
            {
                for (var i = elfClaim.StartingPoint[0]; i < elfClaim.StartingPoint[0] + elfClaim.Size[0]; i++)
                {
                    for (var j = elfClaim.StartingPoint[1]; j < elfClaim.StartingPoint[1] + elfClaim.Size[1]; j++)
                    {
                        if (map[i, j] != elfClaim.Id)
                        {
                            elfClaim.Tainted = true;
                        }
                    }
                }
            }

            return elfClaims.Single(x => x.Tainted == false);
        }

        private static IEnumerable<ElfClaim> GetElfClaims(IEnumerable<string> stringInputValues)
        {
            return stringInputValues.Select(stringInputValue => stringInputValue.Split('@', ':')).Select(values => new ElfClaim {Id = int.Parse(values[0].Trim('#')), StartingPoint = new[] {int.Parse(values[1].Split(',')[0]), int.Parse(values[1].Split(',')[1])}, Size = new[] {int.Parse(values[2].Split('x')[0]), int.Parse(values[2].Split('x')[1])},}).ToList();
        }

        internal class ElfClaim
        {
            public int Id { get; set; }
            public int[] StartingPoint { get; set; }
            public int[] Size { get; set; }
            public bool Tainted { get; set; }
        }
